// src/App.js
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // Importing necessary components
import Login from "./pages/Login"; // Adjust the path to your actual file structure
import Home from "./pages/Home"; // Adjust the path to your actual file structure

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="login" element={<Login />} />
          {/* <Route path="home" element={<Home />} /> */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
